import React from "react";
import { Login } from "../pages/Login/Login";

const ROUTES = [
    {
        path: "/",
        key: "ROOT",
        exact: true,
        component: <Login />
    },
    {
        path: "/app",
        key: "APP",
        exact: true,
        component: <App/>,
        routes: [
            {
                path: "/app",
                key: "APP_ROOT",
                exact: true,
                component: () => <h1>App Index</h1>,
              },
              {
                path: "/app/page",
                key: "APP_PAGE",
                exact: true,
                component: () => <h1>App Page</h1>,
              },
        ]
    }
];

export default ROUTES;
